function TabBar() {
    return (
        <div style={{display:'flex'}}>

            
              
              
              <div className="friendlogo">  
<FaUserFriends style={{height:'30px',width:'30px'}}></FaUserFriends>
<span className="friendtext">Friends</span>
        </div>
               <div className="grouplogo">
            <HiUserGroup style={{height:'30px',width:'30px'}}></HiUserGroup>
            <span className="grouptext">Groups</span>
        </div>
       
        </div>
    )
}

export default TabBar
